import React from 'react';

export default function Header() {
    return (
        <nav class="navbar navbar-light bg-light">
        <div class="container">
          <a class="navbar-brand" href="#">
            <img src="/docs/5.0/assets/brand/bootstrap-logo.svg" alt="" width="30" height="24"/>
          </a>
        </div>
      </nav>
      
    );
}
